	public static byte[] Base64ToBytes(String imageString) throws IOException {
		/*
		BASE64Decoder decoder = new BASE64Decoder();
		byte[] decodedBytes = decoder.decodeBuffer(imageString);
		return decodedBytes;
		*/
		BASE64Encoder decode = new BASE64Encoder();
		byte[] decodedBytes = decode.decode(imageString);
		return decodedBytes;		
		
	}
	
	public static Retorno registrar(Registros registro){
		
		Retorno retorno = new Retorno();
		
		try{
			
			url = new URL("http://localhost:8080/RSCotic/registrar.json");
			   
			con = (HttpURLConnection) url.openConnection();
			con.setRequestMethod("POST"); 
			con.setRequestProperty("User-Agent", USER_AGENT); 
			con.setRequestProperty("Accept-Language", "en-US,en;q=0.5"); 
			con.setRequestProperty("Content-Type","application/json"); 
			    
			//String postJsonData = "{\"id\":5,\"countryName\":\"USA\",\"population\":8000}"; 
			String postJsonData = "{";
			postJsonData += "\"codigoRegistro\":" 		+ registro.getCodigoRegistro() + ",";
			postJsonData += "\"dni\":\"" 				+ registro.getDni() + "\",";
			postJsonData += "\"apellidoPaterno\":\"" 	+ registro.getDni() + "\",";
			postJsonData += "\"apellidoMaterno\":\"" 	+ registro.getDni() + "\",";
			postJsonData += "\"nombres\":\"" 			+ registro.getNombres() + "\",";
			postJsonData += "\"sexo\":\"" 				+ registro.getSexo() + "\",";
			postJsonData += "\"fechaNacimiento\":\"" 	+ registro.getFechaNacimiento() + "\",";
			postJsonData += "\"flagInicio\":" 			+ registro.getFlagFin() + ",";
			postJsonData += "\"flagFin\":" 				+ registro.getFlagInicio() + ",";
			postJsonData += "\"placa\":\"" 				+ registro.getPlaca() + "\",";
			postJsonData += "\"kilometraje\":" 			+ registro.getKilometraje() + ",";
			postJsonData += "\"galones\":" 				+ registro.getGalones() + ",";
			postJsonData += "\"grifo\":\"" 				+ registro.getGrifo() + "\",";
			postJsonData += "\"monto\":"				+ registro.getMonto() + ",";
			postJsonData += "\"comentario\":\"" 		+ registro.getComentario() + "\",";
			postJsonData += "\"latitud\":\"" 			+ registro.getLatitud() + "\",";
			postJsonData += "\"longitud\":\"" 			+ registro.getLongitud() + "\",";
			postJsonData += "\"altitud\":\"" 			+ registro.getAltitud() + "\",";
			postJsonData += "\"fechaRegistro\":\"" 		+ registro.getFechaRegistro() + "\",";
			postJsonData += "\"codigoTipoRegistro\":" 	+ registro.getCodigoTipoRegistro() + ",";
			postJsonData += "\"codigoUsuario\":" 		+ registro.getCodigoUsuario() + ",";
			postJsonData += "\"foto1\":" 				+ registro.getFoto1() + ",";
			postJsonData += "\"foto2\":" 				+ registro.getFoto2() + ",";
			postJsonData += "\"foto3\":" 				+ registro.getFoto3() + ",";
			postJsonData += "\"foto4\":" 				+ registro.getFoto4() + "";
			
			postJsonData += "}";
						
			// Send post request 
			con.setDoOutput(true); 
			DataOutputStream wr = new DataOutputStream(con.getOutputStream()); 
			wr.writeBytes(postJsonData); 
			wr.flush(); 
			wr.close(); 
			    
			int responseCode = con.getResponseCode();
			//System.out.println("\nSending 'POST' request to URL : " + url); 
			//System.out.println("Post Data : " + postJsonData); 
			//System.out.println("Response Code : " + responseCode); 
			    
			BufferedReader in = new BufferedReader(new InputStreamReader(con.getInputStream())); 
			String output; 
			StringBuffer response = new StringBuffer(); 
			    
			while ((output = in.readLine()) != null) { 
				response.append(output); 
			} 
			in.close(); 
			      
			//System.out.println(response.toString()); 
			
			Gson gson = new Gson();

			Type type = new TypeToken<Retorno>(){}.getType();

			retorno = gson.fromJson(response.toString(), type);
			
			//System.out.println("codigo : " + retorno.getCodigo());
			//System.out.println("mensaje : " + retorno.getMensaje());
			
		} catch (MalformedURLException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		}
		
		return retorno;
	}

